import React from "react";
import styled from "styled-components";

const Sns = (props) => {
  const { color, bold } = props;
  const styles = {
    color: color,
    bold: bold,
  };
  return (
    <React.Fragment>
      <SNS {...styles}>{children}</SNS>
    </React.Fragment>
  );
};

Sns.defaultProps = {
  children: null,
  bold: false,
  color: "#2b61e1",
};

const SNS = styled.div`
  color: ${(props) => props.color};
  font-weight: ${(props) => (props.bold ? "800" : "400")};
  margin-right: 4rem;
`;

export default Sns;
